import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './pages/home';


import './App.css';

const App = () => {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/Labaduhhh" element={<Home />} />



        </Routes>
      </div>
    </Router>
  );
};

export default App;
